import { View, Text } from "react-native-web"
import { dataview } from "../styles/Dataview"
import { CommonClass } from "../styles/Commonclass"

export const CardList = ({ name, value }) => {
    return (
                <tr>
                    <td>
                        <Text style={CommonClass.textStyle}>
                            {name}
                        </Text>
                    </td>
                    <td>
                        <Text style={CommonClass.textStyle} >
                            {value}
                        </Text>
                    </td>
                </tr>
    )
}
